description:
Men at Work are an Australian rock  band which achieved international success in the 1980s. They are the only Australian artists to have a #1 album and single simultaneously in the United States (with Business as Usual  and &quot;Down Under&quot; respectively).[1]  At the same time, they also had a simultaneous #1 single and album in the United Kingdom. The group won the 1983 Grammy Award for Best New Artist and sold over 30 million albums worldwide.[citation needed] The band's sound is distinguished by its use of woodwind and brass instruments



